class Banners extends Component {
    render() {
        return(
            <div className="mainbanner">
            <div id="main-banner" className="owl-carousel home-slider">
              <div className="item"> <a href="#"><img src="../ms03/image/banners/pv-banner-897x341-830f5.jpg" alt="main-banner1" className="img-responsive" /></a> </div>
              <div className="item"> <a href="#"><img src="../ms03/image/banners/07_Sep35af28d3770b8292b53a00e6468599ab.jpg" alt="main-banner2" className="img-responsive" /></a> </div>
              <div className="item"> <a href="#"><img src="../ms03/image/banners/09_Sep19ae7763cd670097dbc41a22b7827781.jpg" alt="main-banner3" className="img-responsive" /></a> </div>
            </div>
          </div>
        );
    }
}

export default Banners
